import { Container, Row, Col } from 'reactstrap';

import Position from './Position';
import Orientation from './Orientation';
import Size from './Size';
import Lighting from './Lighting';
import Settings from './Settings';
import BreadcrumbsPos from './BreadcrumbsPos';

function TriggerForm(data, index, updateTrigger) {
    return (
        <>
        {console.log(data)}
            <Container>
                <Row xs="2">
                    <Col className="bg-light border">
                        <Position triggers={data.Triggers} index={index} updateTrigger={updateTrigger}/>
                    </Col>
                    <Col className="bg-light border">
                        <Orientation triggers={data.Triggers} index={index} updateTrigger={updateTrigger}/>
                    </Col>
                </Row>
                <Row>
                    <Col className="bg-light border">
                        <Size triggers={data.Triggers} index={index}/>
                    </Col>
                    <Col className="bg-light border">
                        <Lighting triggers={data.Triggers} index={index} updateTrigger={updateTrigger}/>
                    </Col>
                </Row>
                <Row>
                    <h3>Breadcrumbs</h3>
                    <Col className='bg-light border'>
                        <BreadcrumbsPos triggers={data.Triggers} index={index}></BreadcrumbsPos>
                    </Col>
                    <Col className='bg-light border'>
                        <Settings triggers={data.Triggers} index={index}/>
                    </Col>
                </Row>
            </Container>
        </>
    )
}

export default TriggerForm;
